                deferred.resolve(true);
            });
        return deferred.promise;
    })
    .elementByXPath('//XCUIElementTypeOther[XCUIElementTypeStaticText[starts-with(@value, "Contribution to postage and insurance fees:")]]/XCUIElementTypeStaticText[2]')
    .then(function(e) {
